import React from 'react';
import { css, StyleSheet } from 'aphrodite';

const style = StyleSheet.create({
    defaultButton :{
      color: 'blue',

    }});

const Button = (props) => {
    return (
        <button className={css(props.classname || style.defaultButton)} value={props.state} id={props.id} onClick={props.handleClick} className="button">
        {props.text}</button>
 );
}

export default Button;
